%[text] # S2 | Señales
%%
%[text] ## Señales básicas
%Señal discreta
x = [1 2 3] %[output:91a2a5d2]
n = [-1 0 1] %[output:4021f089]

%Señal continua
syms t
x_1 = t^2 %[output:12bd7655]

%[text] ## Ejercicio 1
syms t 
x = 3*exp(0.4*t) %[output:77632a4b]
y = 2*exp(-0.9*t) %[output:389ae9a4]
fplot(x,[-2,5]) %[output:0c71a0b4] %[output:44315738]
hold on %[output:44315738]
fplot(y,[-2,5]) %[output:44315738]
hold off %[output:44315738]
legend("x(t)","y(t)") %[output:44315738]


%[text] ## Ejercicio 2
syms t
y = cos(t) %[output:094b51f4]
fplot(y,[0 10]) %[output:78c3edce]

n = [0:10] %[output:3ce8a500]
y_1 = cos(n) %[output:4891d6ad]
%plot(n,y_1) Se puede
stem(n,y_1) %[output:03975e81]

%%
%[text] ## Ejercicio 3
syms t
x = cos(t)+sin(3*t) %[output:80e7a8f0]
fplot(x,[0 20]) %[output:30f35e02]

%%
%[text] ## Ejercicio 4
syms t
x = cos(100*t)*exp(2*t) %[output:960fba4f]
fplot(x,[0 2]) %[output:89197540]

%%
%[text] ## Ejercicio 5
syms t
y = 2*exp(1j*pi*t+pi/3) %[output:53bac785]

fplot(real(y),[0 2]) %[output:714a83a2]
hold on %[output:714a83a2]
fplot(imag(y),[0 2]) %[output:714a83a2]
hold off %[output:714a83a2]
legend("Re\{y\}","Im\{y\}") %[output:714a83a2]

%%
%[text] ## Función Heaviside
syms t
u = heaviside(t) %[output:242fc0ac]
fplot(u,[-5 10]) %[output:3e95f773]
ylim([-0.5 1.5]) %[output:3e95f773]
legend("u(t) - heaviside") %[output:3e95f773]

heaviside(0) %[output:087878c3]

n = [-5:10] %[output:70715cf1]
u_n = heaviside(n) %[output:67ef6e24]
stem(n,u_n) %[output:4f887c1f]
%%
%[text] ## Funcion rampa
syms t 
r = t*heaviside(t) %[output:1dbeb391]

fplot(r,[-5 10]) %[output:72a79d44]

%%
%[text] ## Pulso rectangular
syms t
T = 2 %[output:69feadd9]
pT = heaviside(t+T/2)-heaviside(t-T/2) %[output:39c4b526]
fplot(pT,[-5 10]) %[output:995f545a]
ylim([-0.5 1.5]) %[output:995f545a]


%%
%[text] ## Operaciones
syms t
x = t*exp(-t) %[output:5507487f]
%x = heaviside(t)
ylim_interval = [-3 0.5] %[output:7370ec51]
x_interval = [-3 3] %[output:5c3a432f]

%Original
fplot(x, x_interval) %[output:5dbe1073]
ylim(ylim_interval) %[output:5dbe1073]
legend("x(t)") %[output:5dbe1073]

%Reflejada
x_reflex = subs(x,t,-t) %[output:2a20b8a1]
fplot(x_reflex,x_interval) %[output:69f4f8a3]
ylim(ylim_interval) %[output:69f4f8a3]
legend("x_{reflex}(t)") %[output:69f4f8a3]

%Traladada en tiempo
x_tras = subs(x,t,t-2) %[output:7756967f]
fplot(x_tras,x_interval) %[output:6562564b]
ylim(ylim_interval) %[output:6562564b]
legend("x_{trasladada}(t)") %[output:6562564b]

%Ensanchada en tiempo
x_broad = subs(x,t,t/3) %[output:1525719e]
fplot(x_broad,x_interval) %[output:3efa0787]
ylim(ylim_interval) %[output:3efa0787]
legend("x_{broad}(t)") %[output:3efa0787]

%Par & impar
x_e = (1/2)*(x+x_reflex) %[output:4aad8098]
x_o = (1/2)*(x-x_reflex) %[output:8d8b29a5]


fplot(x_e,[-10 10]) %[output:2011ce25]
hold on %[output:2011ce25]
fplot(x_o,[-10 10]) %[output:2011ce25]
fplot(x,[-10 10]) %[output:2011ce25]
hold off %[output:2011ce25]
ylim([-10 10]) %[output:2011ce25]
legend("x_{e}(t)","x_{o}(t)","x(t)") %[output:2011ce25]

%%
%[text] ## RMS de funcion seno
syms t

T = 2*pi %[output:3a43435b]
%Señal
x = sin(t) %[output:28e0438a]
%Energía
E = int(x^2,[0 T]) %[output:72352c2b]
%Potencia
P = E/(T) %[output:2ca838da]
%RMS
RMS = sqrt(P) %[output:4d0e2b94]
var = vpa(RMS) %[output:79b51c37]

